// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Contract name must match file name
contract TenderContract {
    address public owner;
    uint public constant MAX_AMOUNT = 10000;
    uint public constant MAX_TIME = 100 days;

    struct Tender {
        uint id;
        string name;
        uint amount;
        uint completionTime;
        address issuer;
        bool isOpen;
    }

    Tender[] public tenders;
    
    event TenderCreated(uint id, string name, uint amount, uint completionTime);
    event ApplicationSubmitted(uint tenderId, address applicant, uint amount, uint time);
    event ApplicationRejected(uint tenderId, string reason);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function createTender(
        string memory _name,
        uint _amount,
        uint _completionTime
    ) external onlyOwner {
        require(_amount <= MAX_AMOUNT, "Amount exceeds maximum limit");
        require(_completionTime <= MAX_TIME, "Time exceeds maximum limit");
        
        tenders.push(Tender({
            id: tenders.length,
            name: _name,
            amount: _amount,
            completionTime: _completionTime,
            issuer: msg.sender,
            isOpen: true
        }));
        
        emit TenderCreated(tenders.length - 1, _name, _amount, _completionTime);
    }

    function applyToTender(
        uint _tenderId,
        uint _proposedAmount,
        uint _proposedTime
    ) external {
        require(_tenderId < tenders.length, "Invalid tender ID");
        Tender storage tender = tenders[_tenderId];
        
        if(!tender.isOpen) {
            emit ApplicationRejected(_tenderId, "Tender closed");
            revert("Tender closed");
        }
        
        if(_proposedAmount > tender.amount) {
            emit ApplicationRejected(_tenderId, "Amount too high");
            revert("Proposed amount exceeds tender limit");
        }
        
        if(_proposedTime > tender.completionTime) {
            emit ApplicationRejected(_tenderId, "Time too long");
            revert("Proposed time exceeds tender limit");
        }
        
        emit ApplicationSubmitted(_tenderId, msg.sender, _proposedAmount, _proposedTime);
    }

    function getAllTenders() external view returns (Tender[] memory) {
        return tenders;
    }
}

